CREATE TABLE `auc_auction` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `auction_name` varchar(100) NOT NULL COMMENT '拍卖物名称',
  `auction_type` int(11) NOT NULL COMMENT '对应数据字典ID',
  `start_price` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '起拍价格',
  `evaluation_price` decimal(15,2) NOT NULL COMMENT '评估价',
  `scope` decimal(15,2) NOT NULL COMMENT '加价幅度',
  `area_url` varchar(200) NOT NULL COMMENT '城市URL',
  `contact_user` varchar(20) NOT NULL COMMENT '联系人',
  `contact_phone` varchar(30) NOT NULL COMMENT '联系方式',
  `bail` decimal(15,2) NOT NULL COMMENT '保证金金额',
  `start_time` int(11) NOT NULL COMMENT '开始时间',
  `end_time` int(11) NOT NULL COMMENT '结束时间',
  `notice` text NOT NULL COMMENT '拍卖公告',
  `details` text NOT NULL COMMENT '标介绍',
  `status` tinyint(10) NOT NULL DEFAULT '1' COMMENT '状态.1.未开始 2.进行中  3.已结束 4.撤回，5用户发布未审核',
  `uid` int(11) NOT NULL COMMENT '用户ID',
  `serianumber` varchar(50) NOT NULL COMMENT '物品编号(唯一)',
  `clicks` int(11) NOT NULL DEFAULT '0' COMMENT '点击次数',
  `edit_id` int(11) NOT NULL DEFAULT '0' COMMENT '修改的ID。0：正常信息。!=0为所属ID',
  `edit_status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '1正常2申请修改中,3申请修改失败，4申请删除，5申请删除失败,6已删除',
  PRIMARY KEY (`id`),
  KEY `uid` (`uid`) USING BTREE,
  KEY `areaurl` (`area_url`)
) ENGINE=InnoDB AUTO_INCREMENT=176 DEFAULT CHARSET=utf8;

