6666;text-indent:12px;\">\r\n\t<span style=\"font-size:16px;\">周边有较多绿地，基本整洁卫生。按规划设计进行布置，有部分公建配套，有水、电、气、污水系统,有地下及地上停车场，满足停车需要。</span> \r\n</p>\r\n<p style=\"color:#666666;text-indent:12px;\">\r\n\t<span style=\"font-size:16px;\">周围配套设施有：苏州工业园区实验小学、苏州工业园区星湾学校、中天湖畔广场、苏州中心广场、星海国际广场、<a>康稼儿童保健诊所</a>、<a>新城社区卫生服务站</a>、中国光大银行、中国建设银行、中国农业银行等。</span> \r\n</p>\r\n<p style=\"color:#666666;text-indent:12px;\">\r\n\t<span style=\"font-size:16px;\">周围交通便利，估价对象所在区域有现代大道等主干道。路面保养维修较好，道路质量较好，道路通达状况较优。有2路、28路等多条公交线路及地铁一号线由此经过，交通状况较好。</span> \r\n</p>\r\n<p style=\"color:#666666;text-indent:12px;\">\r\n\t<span style=\"font-size:16px;\"> </span>\r\n\t<p>\r\n\t\t拍卖标的调查情况表（房地产）\r\n\t</p>\r\n\t<p>\r\n\t\t拍品名称\r\n\t</p>\r\n\t<p>\r\n\t\t苏州工业园区湖畔花园9幢1单元1601室\r\n\t</p>\r\n\t<p>\r\n\t\t权利来源\r\n\t</p>\r\n\t<p>\r\n\t\t司法裁定\r\n\t</p>\r\n\t<p>\r\n\t\t<br />\r\n\t</p>\r\n\t<p>\r\n\t\t<br />\r\n\t</p>\r\n\t<p>\r\n\t\t拍品现状\r\n\t</p>\r\n\t<p>\r\n\t\t<br />\r\n\t</p>\r\n\t<p>\r\n\t\t<br />\r\n\t</p>\r\n\t<p>\r\n\t\t<br />\r\n\t</p>\r\n\t<p>\r\n\t\t房屋用途及土地性质\r\n\t</p>\r\n\t<p>\r\n\t\t成套住宅\r\n\t</p>\r\n\t<p>\r\n\t\t租赁情况\r\n\t</p>\r\n\t<p>\r\n\t\t无\r\n\t</p>\r\n\t<p>\r\n\t\t钥 匙\r\n\t</p>\r\n\t<p>\r\n\t\t无\r\n\t</p>\r\n\t<p>\r\n\t\t配套情况\r\n\t</p>\r\n\t<p>\r\n\t\t买受人自行查证\r\n\t</p>\r\n\t<p>\r\n\t\t权利限制情况\r\n\t</p>\r\n\t<p>\r\n\t\t有查封、抵押\r\n\t</p>\r\n\t<p>\r\n\t\t拍品介绍\r\n\t</p>\r\n\t<p>\r\n\t\t<br />\r\n\t</p>\r\n\t<p>\r\n\t\t周边有较多绿地，基本整洁卫生。按规划设计进行布置，有部分公建配套，有水、电、气、污水系统,有地下及地上停车场，满足停车需要。\r\n\t</p>\r\n\t<p>\r\n\t\t周围配套设施有：苏州工业园区实验小学、苏州工业园区星湾学校、中天湖畔广场、苏州中心广场、星海国际广场、康稼儿童保健诊所、新城社区卫生服务站、中国光大银行、中国建设银行、中国农业银行等。\r\n\t</p>\r\n\t<p>\r\n\t\t周围交通便利，估价对象所在区域有现代大道等主干道。路面保养维修较好，道路质量较好，道路通达状况较优。有2路、28路等多条公交线路及地铁一号线由此经过，交通状况较好。\r\n\t</p>\r\n\t<p>\r\n\t\t<a href=\"http://www.baidu.com\">http://www.baidu.com</a>\r\n\t</p>\r\n\t<p>\r\n\t\t<a href=\"http://www.sina.com\" target=\"_blank\">http://www.sina.com</a>\r\n\t</p>\r\n\t<p>\r\n\t\t<br />\r\n\t</p>',3,23,'201603140002',14,0,1),(146,'奎文区租房一套',31,100000.00,150000.00,10000.00,'0_