INSERT INTO `auc_auction_charge` VALUES (22,1,100.00,1491234567,'/Uploads/2015-12-22/5678c8b9ed901.png',2,1452232770,'无22','',1,0),(24,1,123.00,1452233302,'/Uploads/2016-01-08/568f4c460fa77.jpg',2,1452233880,'无24','',1,0),(25,1,1241.00,1452233759,'/Uploads/2016-01-08/568f4c460fa77.jpg',2,1452233867,'无25','',1,0),(26,1,123.00,1452236594,'/Uploads/2016-01-08/568f4c460fa77.jpg',2,1456731753,'无26','',1,1),(27,1,11111.00,1452237426,'/Uploads/2016-01-08/568f4c460fa77.jpg',2,1452237771,'测试备注信息','',1,0),(28,1,123.00,1452237478,'/Uploads/2016-01-08/568f4c460fa77.jpg',2,1452237750,'123','',1,0),(29,1,123.00,1452244101,'/Uploads/2016-01-08/568f4c460fa77.jpg',3,1456725964,'无','',1,0),(30,1,11111.00,1452244447,'/Uploads/2016-01-08/568f4c460fa77.jpg',2,1452301273,'过完元旦假期，几乎是一上班，11省份的党委主要负责同志，国务院有关部门负责同志，共同奔向重庆。\r\n　　 11省份，具体说是：上海、江苏、浙江、安徽、江西、湖北、湖南、重庆、四川、贵州、云南。这些大员，要参加一个重要的座谈会：推动长江经济带发展座谈会。没错，习总出席会议并有重要讲话。张高丽（兼“推动长江经济带发展领导小组组长”）也出席。\r\n　　 当时，习总正在重庆调研。他在国内调研期间，常会召集相关省份书记召开座谈会。“一带一路”、京津冀协同发展、长江经济带，是我国重点实施的三大战略。每个都很重要。\r\n　　 就长江经济带，习总有深入思考。他从相关进展、历史文化、生态保护、流域经济、工作机制等维度谈长江经济带建设，可谓给出了推动长江经济带建设的世界观和方法论，如：\r\n　　 谈历史文化，习总强调，长江、黄河都是中华民族的发源地，都是中华民族的摇篮 。通观中华文明发展史，从巴山蜀水到江南水乡，长江流域人杰地灵，陶冶历代思想精英，涌现无数风流人物。\r\n　　 谈生态保护，习总说，长江拥有独特的生态系统，是我国重要的生态宝库。当前和今后相当长一个时期，要把修复长江生态环境摆在压倒性位置，共抓大保护，不搞大开发。\r\n　　 谈流域经济，习近平强调，长江经济带作为流域经济，涉及水、路、港、岸、产、城和生物、湿地、环境等多个方面，是一个整体，必须全面把握、统筹谋划。\r\n　　 已明确的，用“快思维”、做加法：保护生态环境、建立统一市场、加快转方式调结构，这是已经明确的方向和重点，要用“快思维”、做加法。\r\n　　 一时看不透，用“慢思维”，做减法：而科学利用水资源、优化产业布局、统筹港口岸线资源和安排一些重大投资项目，如果一时看不透，或者认识不统一，则要用“慢思维”，有时就要做减法。两难、多难问题，科学论证，比较选优；对一些二选一甚至多选一的“两难”、“多难”问题，要科学论证，比较选优。不能做的，列出负面清单；对那些不能做的事情，要列出负面清单。等等。\r\n　　 更多内容，看通稿。\r\n　　 ――――――――\r\n　　［一］习近平召开推动长江经济带发展座谈会\r\n　　 中共中央总书记、国家主席、中央军委主席习近平5日在重庆召开推动长江经济带发展座谈会，听取有关省市和国务院有关部门对推动长江经济带发展的意见和建议。\r\n　　［二］走生态优先、绿色发展之路\r\n　　 他强调，长江是中华民族的母亲河，也是中华民族发展的重要支撑。推动长江经济带发展必须从中华民族长远利益考虑，走生态优先、绿色发展之路，使绿水青山产生巨大生态效益、经济效益、社会效益，使母亲河永葆生机活力。\r\n　　 中共中央政治局常委、国务院副总理、推动长江经济带发展领导小组组长张高丽出席座谈会并讲话。\r\n　　［三］11省份书记等出席\r\n　　 习近平在重庆调研期间召开这次座谈会，就推动长江经济带发展听取上海、江苏、浙江、安徽、江西、湖北、湖南、重庆、四川、贵州、云南党委主要负责同志 和国务院有关部门负责同志的意见和建议。\r\n　　［四］5位同志发言\r\n　　 座谈会上，重庆市委书记孙政才、上海市委书记韩正、湖北省委书记李鸿忠、国家发展改革委主任徐绍史、环境保护部部长陈吉宁等5位同志发言。他们结合实际，从不同角度就推动长江经','',1,0),(31,6,100000.00,1453085307,'/Uploads/2016-01-08/568f4c460fa77.jpg',2,1453085331,'123','',1,0),(32,6,100000.00,1453094960,'/Uploads/2016-01-08/568f4c460fa77.jpg',2,1453094970,'123','',1,0),(33,1,123.00,1453187173,'/Uploads/2016-01-07/568e2973c9f79.jpg',4,1454489065,'123','',1,0),(34,1,123.00,1453187174,'/Uploads/2016-01-07/568e2973c9f79.jpg',2,1456545365,'123','',1,0),(35,3,123.00,1453188069,'/Uploads/2015-12-22/5678f059c594d.jpg',1,1454489065,'无','',1,0),(36,3,123.00,1453188070,'/Uploads/2015-12-22/5678f059c594d.jpg',1,1452232770,'无','',1,0),(37,1,123111.00,1453188090,'/Uploads/2016-01-07/568e2973c9f79.jpg',3,1454303724,'123123','“十三五”是全面建成小康社会的决胜阶段，今年是开局之年，开好局、起好步，是取得全面胜利的关键一步。如何开好局并取得最后胜利？2016年1月29日，习近平同党外人士共迎新春时指出：“人心向背、力量对比决定事业成败。我们提出坚持正确处理一致性和多样性关系的方针，就是着眼于形成最大公约数，画出最大的同心圆。” 如何画这个最大的同心圆？习近平指出：“要用好政党协商这个民主形式和制度渠道，有事多商量、有事好商量、有事会商量，通过协商凝聚共识、凝聚智慧、凝聚力量。”请随“学习中国”小编一起学习。',1,0),(38,11,10000.00,1453256451,'/Uploads/2015-12-22/5678f059c594d.jpg',2,1453256468,'1234','',1,0),(39,14,100000.00,1453358951,'/Uploads/2015-12-22/5678f059c594d.jpg',2,1453358961,'100','',1,0),(40,16,10000.00,1454394849,'/Uploads/2016-02-02/56b04be6a2d9d.gif',2,1454394985,'无','',1,0),(41,1,1.00,1454488402,'',2,1454489065,'','无',1,0),(42,1,2.00,1454488423,'',2,1454489065,'','无',1,0),(43,1,1000.00,1454488594,'',2,1454489065,'','无',1,0),(44,1,1000.00,1454488605,'',4,1454489065,'','无',1,0),(45,1,1000.00,1454489065,'',2,1454489065,'','无',1,0),(46,1,123.00,1456103982,'',2,1456103982,'','无',1,0),(47,1,123.00,1456104006,'',4,1456104006,'','无',1,0),(48,1,8815817.00,1456104214,'',2,1456104214,'','无',1,0),(49,1,8815817.00,1456104227,'',4,1456104227,'','无',1,0),(50,1,8815817.00,1456104355,'',4,1456104355,'','无',1,0),(51,1,123123.00,1456104621,'',2,1456104621,'','无',1,0),(52,23,5000.00,1456385068,'/Uploads/2016-02-25/56ce941206331.jpg',2,1456385091,'备注信息备注信息',''