#
# Structure for table "auc_student"
#

CREATE TABLE `auc_student` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `school_id` int(11) NOT NULL COMMENT '学校ID',
  `dep_url` varchar(100) NOT NULL,
  `add_uid` int(11) NOT NULL COMMENT '写入人ID',
  `grade` varchar(50) NOT NULL COMMENT '年级',
  `class` varchar(50) NOT NULL COMMENT '班级',
  `name` varchar(50) NOT NULL COMMENT '姓名',
  `id_number` varchar(100) NOT NULL COMMENT '身份证号',
  `id_code` varchar(100) NOT NULL COMMENT '学籍号',
  `pay_fee` decimal(10,2) NOT NULL COMMENT '应交金额',
  `pay_status` tinyint(2) NOT NULL DEFAULT '2' COMMENT '交付状态：1已交付2未交付',
  `pay_time` int(11) NOT NULL COMMENT '缴费时间',
  `add_time` int(11) NOT NULL COMMENT '写入时间',
  `update_uid` int(11) NOT NULL COMMENT '更新UID',
  `update_time` int(11) NOT NULL COMMENT '更新时间',
  `tuition` decimal(10,2) NOT NULL COMMENT '学费',
  `quarterage` decimal(10,2) NOT NULL COMMENT '住宿费',
  `book_fee` decimal(10,2) NOT NULL COMMENT '书本费',
  `busy_book` decimal(10,2) NOT NULL COMMENT '作业本',
  `else_1` decimal(10,2) NOT NULL COMMENT '其他1',
  `else_2` decimal(10,2) NOT NULL COMMENT '其他2',
  `order_id` varchar(30) NOT NULL COMMENT '订单ID',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=425 DEFAULT CHARSET=utf8;

